import React from "react";
import classes from "./header.module.css";

function Header() {
  return (
    <header className={classes.header}>
      <img src="https://static.rcvostok.ru/images/brands/f91f5af39ce347afab47ccb7d8fadacf.png"></img>
    </header>
  );
}

export default Header;
